async function cloneFullScreenButton(gmap, attempt = 0, cloneFromSelector = ".gm-fullscreen-control", controlPosition = google.maps.ControlPosition.RIGHT_TOP, options = {}) {
  let fullScreenControl = document.querySelector(cloneFromSelector);
  return Promise.resolve().then(() => {
    if (!fullScreenControl) {
      if (attempt < 5)
        return waitFor3(1e3).then(() => cloneFullScreenButton(
          gmap,
          attempt++,
          cloneFromSelector,
          controlPosition,
          options
        ));
      return Promise.reject(new Error("No se encontr\xF3 el el bot\xF3n de pantalla completa"));
    }
    let saveMapButton2 = gmap.controls[controlPosition].getAt(0);
    if (!saveMapButton2 || !saveMapButton2.classList.contains("save_map_button")) {
      saveMapButton2 = fullScreenControl.cloneNode(true);
      saveMapButton2.className = "  save_map_button hover:text-black hover:text-3xl text-2xl text-gray-600";
      gmap.controls[controlPosition].push(saveMapButton2);
    }
    return saveMapButton2;
  });
}

