function performLfmRequest2(url, parameter, type) {
  var data2 = defaultParameters();
  if (parameter != null) {
    $.each(parameter, function(key, value) {
      data2[key] = value;
    });
  }
  return $.ajax({
    type: "GET",
    beforeSend: function(request) {
      var token = getUrlParam("token");
      if (token !== null) {
        request.setRequestHeader("Authorization", "Bearer " + token);
      }
    },
    dataType: type || "text",
    url: apiPathName(url),
    data: data2,
    cache: false
  }).then(function(response, textStatus, jqXHR) {
    let { status } = jqXHR;
    if (status > 400 && status < 500) {
      let locationHeader = jqXHR.getResponseHeader("Location");
      if (locationHeader)
        notify(
          "Su sesi\xF3n ha expirado. A continuaci\xF3n ser\xE1 redirigido a la pantalla de inicio de sesi\xF3n"
        ).then(() => location.href = "/logout");
    } else {
      return response;
    }
  }).fail(function(jqXHR, textStatus, errorThrown) {
    displayErrorResponse(jqXHR);
  });
}
